import { Typography, makeStyles } from '@material-ui/core';
import React from 'react'
import StickyNote from '../assets/luis-villasmil-mlVbMbxfWI4-unsplash.jpg'

const withStyles = makeStyles(() => ({
    sectionTwoWrapper: {
        display: "flex",
        justifyContent: "space-evenly",
        alignItems: "center",
    },
    sectionTwoHeader: {
        fontWeight: "bold",
        fontSize: "3rem",
        textAlign: "left",
    },
    sectionTwoText: {
        fontSize: "1rem",
        textAlign: "left"
    },
    sectionTwoContentWrapper: {
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        width: "60%"
    },
    sectionTwoImage: {
        maxHeight: "500px",
        margin: "50px",
        borderRadius: "35px"
    },
    imageWrapper: {
        width: "60%"
    },
    wordHighlight: {
        color: "#AAF0C1",
        fontWeight: "bold",
        fontSize: "3rem"
    },
    sectionTwoHeaderTextWrapper: {
        display: "flex"
    }

}));


const SectionTwo = () => {

    const classes = withStyles();

    return (
        <div className={classes.sectionTwoWrapper}>
            <div className={classes.sectionTwoContentWrapper}>
                <div className={classes.sectionTwoHeaderTextWrapper}>
                    <Typography className={classes.sectionTwoHeader}>Information overload is</Typography>
                    <Typography className={classes.wordHighlight}>&nbsp;real</Typography>
                </div>
                <div>

                </div>


            </div>
            <div className={classes.imageWrapper}>
                <img className={classes.sectionTwoImage} src={StickyNote} />
            </div>
        </div>
    )
}

export default SectionTwo
